"""
438. 找到字符串中所有字母异位词

给定一个字符串 s 和一个非空字符串 p，找到 s 中所有是 p 的字母异位词的子串，返回这些子串的起始索引。
字符串只包含小写英文字母，并且字符串 s 和 p 的长度都不超过 20100。

说明：
字母异位词指字母相同，但排列不同的字符串。
不考虑答案输出的顺序。

示例 1:
输入:
s: "cbaebabacd" p: "abc"
输出:
[0, 6]

解释:
起始索引等于 0 的子串是 "cba", 它是 "abc" 的字母异位词。
起始索引等于 6 的子串是 "bac", 它是 "abc" 的字母异位词。

示例 2:
输入:
s: "abab" p: "ab"
输出:
[0, 1, 2]

解释:
起始索引等于 0 的子串是 "ab", 它是 "ab" 的字母异位词。
起始索引等于 1 的子串是 "ba", 它是 "ab" 的字母异位词。
起始索引等于 2 的子串是 "ab", 它是 "ab" 的字母异位词。


此题解法：最有效率的应该是用‘滑动窗口’方法。窗口的大小就是p的长度。
* 异位词：就是字母以及字母的个数相同的词，如果使用字典的话最容易比对
* 采用滑动窗口只需要遍历s一次，是O(n)的复杂度
* 之前先需要遍历p，将字母以及字母对应的计数存入数组，因为假设都是小写字母，所以用固定的26长度的数组
  正好使用0-25来代表26个字母，位置是代表字母，内容代表字母的计数。
* 然后遍历s，如果指针小于窗口长度，那么依照字母的位置累加对应的计数
  如果大于等于窗口长度，那么累加完下一个字母的计数后，要对应减去窗口末尾字母的计数 i-windowlength
* 然后比较两个数组是否相等，如果相等那么计数末尾的索引就是需要的索引 i-windowlength+1

"""


class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        S = [ord(x) - 97 for x in s]
        P = [ord(x) - 97 for x in p]

        f1 = [0] * 26
        for x in P:
            f1[x] = f1[x] + 1

        f2 = [0] * 26
        windowLength = len(P)
        res = []
        for i, x in enumerate(S):
            f2[x] = f2[x] + 1

            if i >= windowLength:
                f2[S[i - windowLength]] -= 1

            if f1 == f2:
                res.append(i - windowLength + 1)

        return res


s = Solution()
print(s.findAnagrams("abab", "ab"))

